import React, {Component} from 'react';

class Item extends Component {

  render() {
    return  (
      <tbody>
        <thead>
          <tr>
            <th scope="row"> { this.props.inventory.id }</th>
            <td>Vendor</td>
            <td>Vendor</td>
            <td>Vendor</td>
            <td>Vendor</td>
            <td>Vendor</td>
          </tr>
        </thead>
      </tbody>
    );
  }
}
export default Item;
